tidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"13187","type":"Paragraph"},{"attributes":{"below":[{"id":"13141"}],"center":[{"id":"13144"},{"id":"13148"}],"left":[{"id":"13145"}],"plot_height":320,"renderers":[{"id":"13166"},{"id":"13173"}],"title":{"id":"13131"},"toolbar":{"id":"13156"},"x_range":{"id":"13133"},"x_scale":{"id":"13137"},"y_range":{"id":"13135"},"y_scale":{"id":"13139"}},"id":"13130","subtype":"Figure","type":"Plot"},{"attributes":{"data_source":{"id":"12841"},"glyph":{"id":"12842"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"12843"},"selection_glyph":null,"view":{"id":"12845"}},"id":"12844","type":"GlyphRenderer"},{"attributes":{"data_source":{"id":"13163"},"glyph":{"id":"13164"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"13165"},"selection_glyph":null,"view":{"id":"13167"}},"id":"13166","type":"GlyphRenderer"},{"attributes":{"ticks":[1582675200000.0,1583280000000.0,1583884800000.0,1584489600000.0,1585094400000.0,1585699200000.0,1586304000000.0,1586908800000.0,1587513600000.0,1588118400000.0,1588723200000.0,1589328000000.0,1589932800000.0,1590537600000.0,1591142400000.0,1591747200000.0]},"id":"12839","type":"FixedTicker"},{"attributes":{"line_alpha":0.1,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"12836","type":"Line"},{"attributes":{"line_alpha":0.6,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"12835","type":"Line"},{"attributes":{"bottom_units
